    const history = useHistory()

    function createPost(project){
        // initialize cost and services
        project.cost = 0
        project.services = []

        fetch("http>://localhost:5000/projects",{
            method: 'POST',
            headers: {
                'Content-Type': 'aplication/json'
            }
        }).then((resp) => resp.json)
        .then((data) => console.log(data))
        .catch((err) => console.log(err))
    }

